// src/components/Navbar.tsx
import React from 'react';
import { useDispatch } from 'react-redux';
import { useNavigate } from 'react-router-dom';
import profilePic from '../assets/pp.jpg'; // Import the image

const Navbar: React.FC = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const handleLogout = () => {
    // Handle logout logic, e.g., clearing user data
    // Redirect to login page
    navigate('/login');
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">My LinkedIn Clone</div>
      <div className="navbar-user">
        <img src={profilePic} alt="Profile" className="navbar-profile-pic" />
        <button className="navbar-logout" onClick={handleLogout}>Logout</button>
      </div>
    </nav>
  );
};

export default Navbar;
